// import './main.css';

const text = ["Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.", "This is a sample text", "Here is another sample text"]

export default function Main(props: any) {
    return(
        <div className="main">
            <div className="main-header"></div>
            <div className="main-content">

                <div className="message received">
                    {text}
                </div>

                <div className="message sent">
                    {text}
                </div>
                <div className="message received">
                    {text} 
                </div>
                <div className="message received">
                    {text}
                </div>
                <div className="message sent">
                    {text}
                </div>
                <div className="message sent">
                    {text}
                </div>
                <div className="message received">
                    {text} 
                </div>
            </div>
            <div className="main-footer">
                <div className="main-left"></div>
                <input className="message-input" placeholder="iMessage" type="text"></input>
                <div className="main-right"></div>
            </div>
        </div>
    )
}
